import React from 'react'
// import { Link } from 'react-router-dom';

const Report = (props) => {
    return ( 
        <div className="w3-container w3-margin-top" sty>
        <div className="w3-round-xlarge w3-light-gray">
        <div className="w3-container w3-margin">
        <div className="w3-container w3-margin-top">
        <span style={{ marginTop: '1em', paddingBottom: '10px','border-bottom': '1px solid lightgrey'}}><b>{props.data.heading}</b></span>
        </div>
        <div className="w3-container w3-cell-row w3-margin-top">
        <div class="w3-cell">
        <img src="https://www.w3schools.com/w3css/img_avatar3.png" alt="Avatar" className="w3-circle" style={{width:'60px'}}/>
        </div>
        <p><button class="w3-button w3-round-xxlarge w3-text-grey" style={{ paddingLeft: '2em',paddingRight:'2em',backgroundColor: '#ccc',fontSize: '1.2em'}}><b>{props.data.text}</b></button></p>
        </div>
        </div>
        </div>
        </div> 
    );
}

export default Report;
